import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import Cart from './componentsss/Cart'
import Default from './componentsss/Default'
import Details from './componentsss/Details'
import Navbar from './componentsss/Navbar'
import ProductList from './componentsss/ProductList'
import {Switch , Route} from 'react-router-dom'



function App() {
  return (
    <div>

      <Navbar></Navbar>
      <Switch>

        <Route path='/Cart' componentsss={Product}></Route>
        <Route path='/Details' componentsss={Details}></Route>
        <Route path='/Product' componentsss={Cart}></Route>
        <Route componentsss={Default}></Route>
      </Switch>


    </div>
  );
}


export default App
